import React from 'react';
import logo from './logo.svg';
import './App.css';
import countries from 'world-countries';

const CountryInfo = props => {
  return (
    <p>
    Land: {props.data.name}

    </p>
    );
};

function App() {
  console.log(countries);

  return (
    <div className="App">
    <CountryInfo data={countries[0]}/>

    </div>

  );
}

export default App;
